#!/usr/bin/env python

class Solution(object):
    def isIsomorphic(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """

        if not s or not t or len(s) == 0 and len(t) == 0:
            return True
        if len(s) != len(t):
            return False

        swapS_T = {}
        swapT_S = {}

        new_t = []

        for i in range(len(s)):
            if (t[i] in swapT_S) ^ (s[i] in swapS_T):
                return False
            elif t[i] not in swapT_S:
                swapT_S[t[i]] = s[i]
                swapS_T[s[i]] = t[i]
                new_t.append(s[i])
            elif swapT_S[t[i]] == s[i] and swapS_T[s[i]] == t[i]:
                new_t.append(s[i])
            else:
                return False
        return s == ''.join(new_t)

